import axios from 'axios';

// export function RetriveHelloWorld(){
//     return axios.get('http://localhost:8080/hello-world-bean')
// }

const ApiClient = axios.create({baseURL:'http://localhost:8080/'})


export const RetriveHelloWorld = ()=> ApiClient.get('hello-world-bean')

export const RetriveHelloWorldUser = (UserName)=>  ApiClient.get(`hello-world/pathvar/${UserName}`,{
    headers:{
        Authorization:'Basic U2Frc2hhbTpkdW1teQ=='
    }
})

export const basicAuthentication = (token)=> ApiClient.get('basicauth',{
    headers:{
        Authorization:token
    }
})
